        this.state = {
            active: false,
        }
    }

    handleClick() {

    }

    render() {
        return (
            <div id="app-drawer">
                <img src={Drawer} alt="App drawer icon" onClick={this.handleClick}/>
                <ul id="options">
                    <li>Home</li>
                    <li>Projects</li>
                    <li>Research</li>
                    <li>Skills</li>
                    <li>Education</li>
                    <li>Resume</li>
                </ul>
            </div>
        );
    }
}

export default AppDrawer;
